import Navbar from "./navbar";
import img from "./img/imagehome.jpg";


export default function Header(){

    return (
        <div>
            <Navbar />
            <div className="flex flex-col w-full px-15percent">
                <div className="bg-orange-400 w-1/2 justify-center">
                    <h1 href="#">Hello, I am zam</h1>
                    <h3>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. In mollis nunc sed id semper risus in. Nisl nisi scelerisque eu ultrices vitae. Etiam dignissim diam quis enim lobortis scelerisque fermentum dui faucibus. Leo vel orci porta non pulvinar neque laoreet suspendisse. Enim nulla aliquet porttitor lacus. Aenean euismod elementum nisi quis eleifend. Habitasse platea dictumst quisque sagittis purus sit. Arcu vitae elementum curabitur vitae nunc sed velit. Id venenatis a condimentum vitae sapien pellentesque habitant morbi. Sit amet venenatis urna cursus eget nunc scelerisque. Lectus quam id leo in vitae turpis massa sed elementum. In dictum non consectetur a erat. Consectetur adipiscing elit duis tristique sollicitudin nibh sit amet. Elementum pulvinar etiam non quam lacus suspendisse faucibus interdum posuere. Est sit amet facilisis magna.</h3>
                </div>
                <div className="bg-red-300 w-1/2 items-center">
                    <img className="w-80 items-center" src={img} alt="muzamilH"/>
                </div>
            </div>
        </div>
    )
}
